import React from "react";

export default function Footer() {
    return (
        <footer className="justify-content-center fixed-bottom">
        <div className="container">
            <span className="text-muted">Made By Paul Sturm, Seth Andregg, Jacob Andrew, and Dan Kopac.</span>
        </div>
        </footer>
    );
    }
